attributes.style:
#%(id)s table
{
	height:0!important;
	border-collapse:collapse;
	border:0;
	margin-top:10px;

}

#%(id)s caption
{
	text-align:left;
	font-size:18px;
	margin-bottom:15px;
}

#%(id)s table .thead
{
	background:#fff url(/168eab1b-d9e1-9d79-01ce-0211fc938fbf.png);
	background-repeat:repeat-x;
	background-position:bottom right;
	border:0;
	border-top:1px solid #ececec;
	border-bottom:1px solid #ececec;
	border-radius:4px;
	-moz-border-radius:4px;
	-webkit-border-radius:4px;
}

#%(id)s table .thead .th-cell
{
	border:0;
	text-align:left;

}

#%(id)s table .thead .th-cell-0
{
	border:0;
	border-left:1px solid #ececec;
	border-radius:4px;
	-moz-border-radius:4px;
	-webkit-border-radius:4px;
	width:32px;
}


#%(id)s table th.th-cell-1 {
	width: 16px;
	opacity: 0;
	padding: 0;
	margin: 1px;
}

#%(id)s table .thead .th-cell-3
{
	border:0;
	border-right:1px solid #ececec;
	border-radius:4px;
	-moz-border-radius:4px;
	-webkit-border-radius:4px;
}

#%(id)s table tr td
{
	border:0;
	text-align:left;
	border-bottom:1px dotted #bfbfbf;
	line-height:27px;
	cursor: default;
}

#%(id)s .row:hover {
	border-bottom: 	1px solid #5CB1DD;
	border-top: 	1px solid #5CB1DD !important;
}

#%(id)s .row {
	border-bottom:	1px dotted #bfbfbf;
	border-top: 	1px dotted #bfbfbf;
}

#%(id)s .row_selected
{
	border-bottom: 	1px solid #7Cd1fD;
	border-top: 	1px solid #7Ce1fD !important;
}

#%(id)s .row_selected:hover
{
	border-bottom: 	1px solid #5CB1DD;
	border-top: 	1px solid #5CB1DD !important;

}
